    var urlfecht = url
    const [data, setData] = useState(null);
    useEffect(()=>{
      fetch(urlfecht)
        .then(response => response.json())
        .then((data) => setData(data));
      },[]);

      const columns = [
        {
          name: 'Frase',
          selector: 'data.quote',
          sortable: true,
        },
        {
          name: 'Personaje',
          selector: 'data.character',
          sortable: true,
        },
        {
          name: 'Imagen',
          selector: 'data.image',
          sortable: true,
        },
        {
          name: 'Politica',
          selector: 'characterDirection',
        },
      ];


    return(
      console.log(data)
    )

}
